import { Table, TableHead, TableCell, TableRow } from "@mui/material";
import { useEffect, useState } from "react";
import { showUserDetail } from "../service/api";

const AllUser = () => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    getAllUsers();
  }, []);

  const getAllUsers = async () => {
    let response = await showUserDetail();
    setUsers(response.data);
  };

  return (
    <Table>
      <TableHead>
        <TableRow>
          <TableCell>Id</TableCell>
          <TableCell>Name</TableCell>
          <TableCell>UserName</TableCell>
          <TableCell>Email</TableCell>
          <TableCell>Phone</TableCell>
        </TableRow>
        <TableBody>
          {
          users.map((user) => (
            <TableRow>
              <TableCell>{user._id}</TableCell>
              <TableCell>{user._name}</TableCell>
              <TableCell>{user._username}</TableCell>
              <TableCell>{user._email}</TableCell>
              <TableCell>{user._phone}</TableCell>
            </TableRow>
          ))
          }
        </TableBody>
      </TableHead>
    </Table>
  );
};

export default AllUser;
